module X = struct type t = node let equal t1 t2 = match t1, t2 with | Var s1, Var s2 -> s1 = s2 | App (t11, t12), App (t21, t22) -> t11 == t21 && t12 == t22 | Lam (s1, t1), Lam (s2, t2) -> s1 = s2 && t1 == t2 | _ -> false let hash = function | Var s -> Hashtbl.hash s | App (t1, t2) -> t1.tag * 19 + t2.tag | Lam (s, t) -> Hashtbl.hash s * 19 + t.tag
end
module H = Make(X) let ht = H.create 17
let var s = H.hashcons ht (Var s)
let app t1 t2 = H.hashcons ht (App (t1,t2))
let lam s t = H.hashcons ht (Lam (s,t)) let x = var "x"
let delta = lam "x" (app x x)
let omega = app delta delta let () = assert (var "x" == x)
