In the source, Stdlib.compare is provided as an FFI, and the actual implementation is in the C code of the runtime: (* https://github.com/ocaml/ocaml/blob/trunk/stdlib/stdlib.ml#L72 *)
external compare : 'a -> 'a -> int = "%compare" (* https://github.com/ocaml/ocaml/blob/trunk/runtime/compare.c#L339 *)
CAMLprim value caml_compare(value v1, value v2)
{ intnat res = compare_val(v1, v2, 1); if (res < 0) return Val_int(LESS); else if (res > 0) return Val_int(GREATER); else return Val_int(EQUAL);
} The other sibing functions are also wrapping compare_val e.g. <>(notequal), <(lessthan), <=(lessequal) and the implementation is easy to infer. The third argument total is only set to 1 for caml_compare (a.k.a Stdlib.compare) and 0 otherwise. // https://github.com/ocaml/ocaml/blob/trunk/runtime/compare.c#L88C42-L88C42
static intnat compare_val(value v1, value v2, int total)
{ struct compare_stack stk; intnat res; stk.stack = stk.init_stack; stk.limit = stk.stack + COMPARE_STACK_INIT_SIZE; res = do_compare_val(&stk, v1, v2, total); compare_free_stack(&stk); return res;
} campare_val prepares a stack and invokes a worker function do_compare_val to perform the comparison. do_compare_val performs the structural comparison on the low-level representations. By keeping only the tag cases, a simplified do_compare_val is: static intnat do_compare_val(struct compare_stack* stk, value v1, value v2, int total)
{ struct compare_item * sp; tag_t t1, t2; sp = stk->stack; while (...) { while (...) { if (v1 == v2 && total) goto next_item; if (Is_long(v1)) { if (v1 == v2) goto next_item; if (Is_long(v2)) return Long_val(v1) - Long_val(v2); switch (Tag_val(v2)) { case Forward_tag: v2 = Forward_val(v2); continue; case Custom_tag: { int res = compare(v1, v2); if (Caml_state->compare_unordered && !total) return UNORDERED; if (res != 0) return res; goto next_item; } default: /*fallthrough*/; } return LESS; /* v1 long < v2 block */ } if (Is_long(v2)) { // ... symmetry of the above code } return GREATER; /* v1 block > v2 long */ } t1 = Tag_val(v1); t2 = Tag_val(v2); if (t1 != t2) { if (t1 == Forward_tag) { v1 = Forward_val (v1); continue; } if (t2 == Forward_tag) { v2 = Forward_val (v2); continue; } if (t1 == Infix_tag) t1 = Closure_tag; if (t2 == Infix_tag) t2 = Closure_tag; if (t1 != t2) return (intnat)t1 - (intnat)t2; } switch(t1) { case Forward_tag: { v1 = Forward_val (v1); v2 = Forward_val (v2); continue; } case String_tag: // ... string case case Double_tag: // ... double case case Double_array_tag: // ... double array case case Abstract_tag: case Closure_tag: case Infix_tag: case Cont_tag: // ... invalid cases case Object_tag: { intnat oid1 = Oid_val(v1); intnat oid2 = Oid_val(v2); if (oid1 != oid2) return oid1 - oid2; break; } case Custom_tag: { int res; int (*compare)(value v1, value v2) = Custom_ops_val(v1)->compare; /* Hardening against comparisons between different types */ if (compare != Custom_ops_val(v2)->compare) { return strcmp(Custom_ops_val(v1)->identifier, Custom_ops_val(v2)->identifier) < 0 ? LESS : GREATER; } if (compare == NULL) { compare_free_stack(stk); caml_invalid_argument("compare: abstract value"); } Caml_state->compare_unordered = 0; res = compare(v1, v2); if (Caml_state->compare_unordered && !total) return UNORDERED; if (res != 0) return res; break; } default: { mlsize_t sz1 = Wosize_val(v1); mlsize_t sz2 = Wosize_val(v2); /* Compare sizes first for speed */ if (sz1 != sz2) return sz1 - sz2; if (sz1 == 0) break; /* Remember that we still have to compare fields 1 ... sz - 1. */ if (sz1 > 1) { if (sp >= stk->limit) sp = compare_resize_stack(stk, sp); struct compare_item* next = sp++; next->v1 = v1; next->v2 = v2; next->size = Val_long(sz1); next->offset = Val_long(1); } /* Continue comparison with first field */ v1 = Field(v1, 0); v2 = Field(v2, 0); continue; } } next_item: /* Pop one more item to compare, if any */ if (sp == stk->stack) return EQUAL; /* we're done */ struct compare_item* last = sp-1; v1 = Field(last->v1, Long_val(last->offset)); v2 = Field(last->v2, Long_val(last->offset)); last->offset += 2;/* Long_val(last->offset) += 1 */ if (last->offset == last->size) sp--; } }
